        public string GetPropertyValue(string name)
        {
            switch (name)
            {
                case "INT_DOM":
                    return INT_DOM;
                case "ARR_DEP":
                    return ARR_DEP;
                case "FL_STATUS_1":
                    return FL_STATUS_1;
                case "AIRLINE":
                    return AIRLINE;
                case "AIRLINE_DESCR":
                    return AIRLINE_DESCR;
                case "FL_NUMBER":
                    return FL_NUMBER;
                case "SCH_TIME_O":
                    return SCH_TIME_O;
                case "SCH_TIME":
                    return SCH_TIME;
                case "EST_TIME":
                    return EST_TIME;
                case "EST_TIME_O":
                    return EST_TIME_O;
                case "JOINT_FLAG":
                    return JOINT_FLAG;
                case "JOINT_MASTER_ID":
                    return JOINT_MASTER_ID;
                case "ROUTING":
                    return ROUTING;
                case "ROUTING_ENG":
                    return ROUTING_ENG;
                case "ROUTING_KA":
                    return ROUTING_KA;
                case "VIA":
                    return VIA;
                case "VIA_ENG":
                    return VIA_ENG;
                case "VIA_KA":
                    return VIA_KA;
                case "TD_TIME":
                    return TD_TIME;
                case "TOFF_TIME":
                    return TOFF_TIME;
                case "PUB_RMK":
                    return PUB_RMK;
                case "PUB_RMK_ENG":
                    return PUB_RMK_ENG;
                case "PUB_RMK_KA":
                    return PUB_RMK_KA;
                case "AIRCRAFT_TYPE":
                    return AIRCRAFT_TYPE;
                case "REGISTRATION":
                    return REGISTRATION;
                case "CHECKIN_1":
                    return CHECKIN_1;
                case "CHECKIN_2":
                    return CHECKIN_2;
                case "GATE_1":
                    return GATE_1;
                case "BAGGAGE_1":
                    return BAGGAGE_1;
                case "TERMINAL":
                    return TERMINAL;
                //case "FLIGHT":
                //    return FLIGHT;
                default:
                    return null;
            }

        }
